erecht zu werden, steht das Zuhren und achtsame Beraten bei uns an erster Stelle.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(243,411,1,'Ren Sigrist','2022-05-16 14:40:38','2022-09-02 11:52:37','50a804c3-2219-4ff8-80d7-a9e0ed1cbd75',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ren Sigrist','Inhaber, Managing Partner','+41 79 455 65 47','rene.sigrist@lautissimi.ch','Ich bin fasziniert von der Einzigartigkeit, die in jedem unserer Projekte steckt. Die immer wieder neuen Ausgangslagen erfordern flexibles Denken und viel Einfhlungsvermgen. Um die passende Produktlsung fr unsere Kunden zu finden, helfen mir neben meiner langjhrigen Erfahrung auch die von Vertrauen geprgte Zusammenarbeit mit den Herstellern. Meine handwerkliche Grundausbildung sowie Weiterbildungen im Marketing mit dem Master fr Dienstleistungsmarketing an der HSLU untersttzen mich im Alltag bei praktischen Aufgaben. Ein vielseitiges Interesse und das Anpacken von Themen ausserhalb meines gewohnten Umfeldes zeichnen mich zustzlich aus. Denn mein Ziel ist es, immer ein Auge auf dem Mehrwert fr Kunden und Gste zu behalten.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(244,412,1,'Ren Sigrist','2022-05-16 14:41:33','2022-05-16 14:41:33','17224b7b-4aa8-4ba7-ae6a-3929065d785c',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ren Sigrist','Inhaber, Managing Partner','tel:+41-79-455-65-47','mailto:rene.sigrist@lautissimi.ch','Ich bin fasziniert von der Einzigartigkeit, die in jedem unserer Projekte steckt. Die immer wieder neuen Ausgangslagen erfordern flexibles Denken und viel Einfhlungsvermgen. Um die passende Produktlsung fr unsere Kunden zu finden, helfen mir neben meiner langjhrigen Erfahrung auch die von Vertrauen geprgte Zusammenarbeit mit den Herstellern. Meine handwerkliche Grundausbildung sowie Weiterbildungen im Marketing mit dem Master fr Dienstleistungsmarketing an der HSLU untersttzen mich im Alltag bei praktischen Aufgaben. Ein vielseitiges Interesse und das Anpacken von Themen ausserhalb meines gewohnten Umfeldes zeichnen mich zustzlich aus. Denn mein Ziel ist es, immer ein Auge auf dem Mehrwert fr Kunden und Gste zu behalten.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(245,413,1,'Beatrix Otahal','2022-05-16 14:41:42','2022-09-02 11:53:41','1d7c6986-174c-45f6-8fc1-f1c05fa2ae56',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Inhaberin, Managing Partner','+41 78 625 50 78','beatrix.otahal@lautissimi.ch','Bereits in sehr jungen Jahren war klar, Innenarchitektur ist meine Zukunft. Die solide Ausbildung erlaubte den Einstieg zum Studium der Architektur und der Handelswissenschaften in sterreich. \n\nMeine beruflichen Erfahrungen in den Bereichen Bauwesen, 3D-CAD, Schreinerei und FF&E sammelte ich im Raum Europa und zuletzt schweizweit. Diese ber Jahre erarbeitete Kompetenz fr individuelle Mblierungen, massgeschneiderte, dekorative Beleuchtungen und umfangreichen Materialisierungen bilden eine wertvolle Ergnzung zu Herstellerprodukten. Die Grndung LAUTISSIMI Wien 2014 war mein Start zur Selbstndigkeit mit anschliessender beruflicher Etablierung in der Schweiz.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(246,414,1,'Beatrix Otahal','2022-05-16 14:42:41','2022-05-16 14:42:41','cca8d0f9-1307-46b4-ba95-dbaeb78b5d6d',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Inhaberin, Managing Partner','http://+41+78+625+50+78','http://beatrix.otahal@lautissimi.ch','Rume zu kreieren, in denen sich Gste wohl fhlen ist meine Spezialitt. Die Arbeit mit physischen Produkten in Abstimmung mit Materialien, Formen und Farben liegt mir sehr. In der Zusammenarbeit mit Bauherren, Architekten, Innenarchitekten und Gestaltern erarbeite und finde ich immer die optimale Lsung. Meine Aus- und Weiterbildungen in Gestaltung und Planung und die tiefen Kenntnisse in der Materialkunde erleichtern mir dabei die tgliche Arbeit. Mit Begeisterung ergnze ich die Mbel und Textilien mit individuellen dekorativen Leuchten. Viele Jahre entwickelte und realisierte ich in Zusammenarbeit mit Interior Designern und Produzenten Leuchten aller Arten und Dimensionen. Die Wirkung solcher Objekte im Raum ist enorm und das Resultat fr Gste, Kunden und mich selbst immer wieder ein Erlebnis.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(248,419,1,'About','2022-05-16 15:17:19','2022-05-16 15:17:19','9ef9df54-a98a-468c-a709-3f0e92a93a9a',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'ber uns',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<p class=\"paragraph\">Um Ihnen und der <strong>Individualitt</strong>, die sie suchen, gerecht zu werden, steht das Zuhren und achtsame Beraten bei uns an erster Stelle.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(250,437,1,'Footer','2022-05-18 06:59:55','2022-05-18 06:59:55','a01a0884-60f8-4ab9-8596-d87879c664eb',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022 O&S Interior GmbH','Ihr Prokekt. Unsere Passion.','Lernen Sie uns persnlich kennen. Wir nehmen uns gerne Zeit fr Ihre Projektidee.','Kontakt',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(252,443,1,'Contact Form','2022-05-18 10:54:14','2022-05-18 10:54:14','f10dbcd1-1a9f-436a-8daa-64b06ba978f6',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<p>* Mit dem Senden sind Sie mit unserer &lt;a class=\"disclaimer__link\"&gt;Datenschutzerklrung&lt;/a&gt; einverstanden.</p>','Senden',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NU