ucts.\nThe founding of LAUTISSIMI Vienna in 2014 was my start to\nindependence with subsequent professional\nestablishment in Switzerland.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1339,1978,2,'Ren Sigrist','2022-06-02 21:36:47','2022-06-02 21:36:47','56eddbcb-1924-47f3-83ae-ddcc2a2d3f11',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ren Sigrist','Owner, Managing Partner','+41 79 455 65 47','rene.sigrist@lautissimi.ch','I am fascinated by the uniqueness that lies in each of our projects. The ever-changing initial situations require flexible thinking and a great deal of empathy. In order to find the right product solution for our customers, I am helped not only by my many years of experience but also by the trusting cooperation with the manufacturers. My basic training as a craftsman as well as further training in marketing with a master\'s degree in services marketing at the HSLU support me in practical tasks on a day-to-day basis. A wide range of interests and the ability to tackle topics outside of my usual environment also distinguish me. Because my goal is to always keep an eye on the added value for customers and guests.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1340,1978,1,'Ren Sigrist','2022-06-02 21:36:47','2022-06-02 21:36:47','098548d6-6a36-491e-86f1-1d03cd2fa8ca',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ren Sigrist','Inhaber, Managing Partner','+41 79 455 65 47','rene.sigrist@lautissimi.ch','Ich bin fasziniert von der Einzigartigkeit, die in jedem unserer Projekte steckt. Die immer wieder neuen Ausgangslagen erfordern flexibles Denken und viel Einfhlungsvermgen. Um die passende Produktlsung fr unsere Kunden zu finden, helfen mir neben meiner langjhrigen Erfahrung auch die von Vertrauen geprgte Zusammenarbeit mit den Herstellern. Meine handwer