and out. Because I keep always a strong eye to the added value for customers and guests.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1394,2059,1,'Ren Sigrist','2022-08-24 01:30:32','2022-08-24 01:30:32','a631b27a-135b-4266-90e8-a48b6e5156d2',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ren Sigrist','Inhaber, Managing Partner','+41 79 455 65 47','rene.sigrist@lautissimi.ch','Ich bin fasziniert von der Einzigartigkeit, die in jedem unserer Projekte steckt. Die immer wieder neuen Ausgangslagen erfordern flexibles Denken und viel Einfhlungsvermgen. Um die passende Produktlsung fr unsere Kunden zu finden, helfen mir neben meiner langjhrigen Erfahrung auch die von Vertrauen geprgte Zusammenarbeit mit den Herstellern. Meine handwerkliche Grundausbildung sowie Weiterbildungen im Marketing mit dem Master fr Dienstleistungsmarketing an der HSLU untersttzen mich im Alltag bei praktischen Aufgaben. Ein vielseitiges Interesse und das Anpacken von Themen ausserhalb meines gewohnten Umfeldes zeichnen mich zustzlich aus. Denn mein Ziel ist es, immer ein Auge auf dem Mehrwert fr Kunden und Gste zu behalten.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1397,2061,1,'Beatrix Otahal','2022-08-24 01:31:01','2022-08-24 01:31:01','0fa7db30-4113-4278-88f0-3bee5d2f104c',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Inhaberin, Managing Partner','+41 78 625 50 78','beatrix.otahal@lautissimi.ch','Very early childhood ambition of interior design has been the determining begin studying architecture and economic sciences.\n\nProfessional qualifications had been acquired by working focused on topics of architecture, 3D-CAD, carpentry and  FF&E in Europe and at least in Switzerland. These decades of experience are valuable skills in technical planning, custom-made production of decorative lighting and individual interiors additional to the range of standard products. \nThe foundation of LAUTISSIMI Vienna in 2014 was markable for the beginning of my self-employment and was proceeded in 2016 with subsequent professional establishment in Switzerland.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1398,2061,2,'Beatrix Otahal','2022-08-24 01:31:01','2022-08-24 01:31:01','a4bf031a-4071-458c-aa71-332a2f1f8f4f',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Owner, Managing Partner','+41 78 625 50 78','beatrix.otahal@lautissimi.ch','From a very young age, it was clear that interior design was my\nmy future. The solid education allowed the\nto study architecture and commercial sciences in\ncommercial sciences in Austria.\n\nMy professional experience in the fields of\nconstruction, 3D-CAD, carpentry and FF&E I gained in\nin Europe and finally in Switzerland. This over\nyears of expertise for individual\nfurnishings and\ntailor-made, decorative\nlighting are a valuable addition to the\nmanufacturer products.\nThe founding of LAUTISSIMI Vienna in 2014 was my start to\nindependence with subsequent professional\nestablishment in Switzerland.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1399,2062,1,'Beatrix Otahal','2022-08-24 01:31:06','2022-08-24 01:31:06','4172c1f0-ef1a-4044-8b40-34dfac6ff153',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Inhaberin, Managing Partner','+41 78 625 50 78','beatrix.otahal@lautissimi.ch','Very early childhood ambition of interior design has been the determining begin studying architecture and economic sciences.\n\nProfessional qualifications had been acquired by working focused on topics of architecture, 3D-CAD, carpentry and  FF&E in Europe and at least in Switzerland. These decades of exp