 schweizweit. Diese ber Jahre erarbeitete Kompetenz fr individuelle Mblierungen, massgeschneiderte, dekorative Beleuchtungen und umfangreichen Materialisierungen bilden eine wertvolle Ergnzung zu Herstellerprodukten. Die Grndung LAUTISSIMI Wien 2014 war mein Start zur Selbstndigkeit mit anschliessender beruflicher Etablierung in der Schweiz.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2220,2675,2,'Beatrix Otahal','2022-09-02 11:48:46','2022-09-02 11:48:46','74bd1241-3284-4b58-a8e2-34b2552a5ad6',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Owner, Managing Partner','+41 78 625 50 78','beatrix.otahal@lautissimi.ch','From a very young age, it was clear that interior design was my\nmy future. The solid education allowed the\nto study architecture and commercial sciences in\ncommercial sciences in Austria.\n\nMy professional experience in the fields of\nconstruction, 3D-CAD, carpentry and FF&E I gained in\nin Europe and finally in Switzerland. This over\nyears of expertise for individual\nfurnishings and\ntailor-made, decorative\nlighting are a valuable addition to the\nmanufacturer products.\nThe founding of LAUTISSIMI Vienna in 2014 was my start to\nindependence with subsequent professional\nestablishment in Switzerland.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2223,2677,1,'Ren Sigrist','2022-09-02 11:52:37','2022-09-02 11:52:37','63d348b3-ebc2-40c0-b0c0-bca34b52a0b8',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ren Sigrist','Inhaber, Managing Partner','+41 79 455 65 47','rene.sigrist@lautissimi.ch','Ich bin fasziniert von der Einzigartigkeit, die in jedem unserer Projekte steckt. Die immer wieder neuen Ausgangslagen erfordern flexibles Denken und viel Einfhlungsvermgen. Um die passende Produktlsung fr unsere Kunden zu finden, helfen mir neben meiner langjhrigen Erfahrung auch die von Vertrauen geprgte Zusammenarbeit mit den Herstellern. Meine handwerkliche Grundausbildung sowie Weiterbildungen im Marketing mit dem Master fr Dienstleistungsmarketing an der HSLU untersttzen mich im Alltag bei praktischen Aufgaben. Ein vielseitiges Interesse und das Anpacken von Themen ausserhalb meines gewohnten Umfeldes zeichnen mich zustzlich aus. Denn mein Ziel ist es, immer ein Auge auf dem Mehrwert fr Kunden und Gste zu behalten.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2224,2677,2,'Ren Sigrist','2022-09-02 11:52:37','2022-09-02 11:52:37','7b0bdd32-ade9-4d2a-a15c-5ad5caa8f0b7',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ren Sigrist','Owner, Managing Partner','+41 79 455 65 47','rene.sigrist@lautissimi.ch','Im fascinated of uniqueness by each single project.\nConstantly new initial situations requires flexible thinking\nand a lot of empathy. To find the suitable solution for our\ncustomers I benefit of my vast experience and the\ncooperation with the manufacturers based on trust. The\napprenticed certification to interior decorator and Master\'s\ndegree in Service Marketing at the Lucerne University of\nApplied Sciences and Arts assist me comprehensive all day\nby practical tasks. Additionally a versatile interest and\ntackling topics outside of my usual environment make me\nstand out. Because I keep always a strong eye to the added\nvalue for customers and guests.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2227,2679,2,'Beatrix Otahal','2022-09-02 11:53:41','2022-09-02 11:53:41','150c781f-9f47-4d10-a5e8-002eb01cb237',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Owner, Managing Partner','+41 78 625 50 78','beatrix.otahal@lautissimi.ch','Very early childhood ambition of interior design has been the determining begin studying architecture and economic sciences. \nProfessional qualifications had been acquired by working focused on topics of architecture, 3D-CAD, carpentry and FF&E in Europe and at least in Switzerland. These decades of experience are valuable skills in technical planning, custom-made production of decorative lighting and individual interiors additional to the range of standard products. \nThe foundation of LAUTISSIMI Vienna in 2014 was markable for the beginning of my self-employment and was proceeded in 2016 with subsequent professional establishment in Switzerland.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2228,2679,1,'Beatrix Otahal','2022-09-02 11:53:41','2022-09-02 11:53:41','92953e59-2005-4d2f-86f0-6ceb144dd6ee',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Beatrix Otahal','Inhaberin, Managing Partner','+41 78 625 50 78','beatrix.otahal@lautissimi.ch','Bereits in sehr jungen Jahren war klar, Innenarchitektur ist meine Zukunft. Die solide Ausbildung erlaubte den Einstieg zum Studium der Architektur und der Handelswissenschaften in sterreich. \n\nMeine beruflichen Erfahrungen in den Bereichen Bauwesen, 3D-CAD, Schreinerei und FF&E sammelte ich im Raum Europa und zuletzt schweizweit. Diese ber Jahre erarbeitete Kompetenz fr individuelle Mblierungen, massgeschneiderte, dekorative Beleuchtungen und umfangreichen Materialisierungen bilden eine wertvolle Ergnzung zu Herstellerprodukten. Die Grndung LAUTISSIMI Wien 2014 war mein Start zur Selbstndigkeit mit anschliessender beruflicher Etablierung in der Schweiz.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2229,2680,1,'Park Hyatt Vienna','2022-09-03 12:22:47','2022-12-26 12:41:57','09a236b2-0023-413e-bfed-7867f2b59568',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NUL