ULL,'Polstermbel / Betten / Teppiche / Beleuchtung / Vorhnge','Designausarbeitung auf Basis von Gestaltungsideen inkl. Sonderanfertigungen und Lieferung von 2 der 3 Musterzimmer.\nEs folgte die Beauftragung fr den Westtrakt mit 40 Suiten und Zimmer fr die massgeschneiderten Mbel wie Sofas, Spezial-Betten, Fauteuil und Sessel, sowie alle Vorhnge. Dabei wurden auch Stoffe mit geschtzten Original Jugendstil-Muster von Josef Hoffmann verwendet. Anlieferungen und Montagen erfolgten hier etappiert in Absprache mit den anderen Gewerken, sodass eine erfolgreiche Wieder-Erffnung gewhrleistet blieb.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-2022','Celerina - St. Moritz',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'big',0,NULL),(2712,3073,2,'Hotel Cresta Palace (Polstermbel / Betten / Teppiche / Beleuchtung / Vorhnge)','2023-03-29 15:51:18','2023-03-29 15:51:18','c507571a-2e37-486f-be22-f44dce5a8521',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Polstermbel / Betten / Teppiche / Beleuchtung / Vorhnge','Design developement incl. customized furnitures and delivery for 2 of 3 mock-up rooms.\nFollowed by contract for the Westwing of the hotel consisting of 40 suites and hotelrooms.\nAll interiors incl. bedsofas, chaiselounges, special beds, chairs and armchairs, even the complete package of curtains are custom-made. We also used some high-quality fabrics with patented original patterns of gorgeous Art Nouveau artist Josef Hoffmann.\nComplete delivery and installation were carried out in stages in consultation with the other companies on site, so a successful re-opening was ensured.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-2022','Celerina - St. Moritz',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'big',0,NULL),(2713,3075,1,'Newsletter','2023-04-03 09:46:31','2023-04-03 09:48:48','b0adbae3-36f3-4a7b-bd04-e77f87a2399c','Newsletter | LAUTISSIMI','Melden Sie sich fr unseren Newsletter an und wir werden Sie auf dem Laufe